create database Western_countries_financial_data;

CREATE TABLE Financial_data 
(
    Segment	VARCHAR(512),
    Country	VARCHAR(512),
     Product 	VARCHAR(512),
     Discount_Band 	VARCHAR(512),
    Units_Sold 	VARCHAR(512),
    Manufacturing_Price	VARCHAR(512),
    Sale_Price	VARCHAR(512),
    Gross_Sales	VARCHAR(512),
    Discounts	VARCHAR(512),
     Sales	VARCHAR(512),
    COGS	VARCHAR(512),
    Profit	VARCHAR(512),
    Date	VARCHAR(512),
    Month_Number	INT,
     Month_Name 	VARCHAR(512),
    Year	INT
);
 

 